import React from 'react';

const Footer = () => {
    return (
        <div className="footer">
        <div>
            <p>powered by: <a href='https://reactjs.org/' className="Blue-Icon">
            <svg className="App-logo" viewBox="0 0 15 15" fill="none" xmlns="http://www.w3.org/2000/svg" width="20" height="20"><path d="M14.5 7.584c0 1.657-3.134 3-7 3s-7-1.343-7-3 3.134-3 7-3 7 1.343 7 3z" stroke="currentColor"></path><path d="M4.166 13.739c1.457.79 4.13-1.327 5.972-4.726 1.841-3.4 2.153-6.795.696-7.584-1.457-.79-4.13 1.327-5.972 4.726-1.841 3.4-2.153 6.795-.696 7.584z" stroke="currentColor"></path><path d="M10.834 13.739c-1.457.79-4.13-1.327-5.972-4.726-1.841-3.4-2.153-6.795-.696-7.584 1.457-.79 4.13 1.327 5.972 4.726 1.841 3.4 2.153 6.795.696 7.584z" stroke="currentColor"></path><path d="M6.5 7.584a1 1 0 102 0 1 1 0 00-2 0z" stroke="currentColor"></path></svg>            </a>
            </p>
        </div>
        </div>
    )
}

export default Footer;
